import React from "react";
import {View} from 'react-native'
import {ListItem} from "react-native-elements";


const SellersList = sellers => {
    const sellerList = sellers.sellers;
    if (sellerList && sellerList.length > 0){
        console.log(sellerList)
        console.log("LENGTH TEST")
    }

    return (
        <View>
            {sellerList != null && sellerList.map((seller) => (
                <ListItem title={seller.name} subtitle={seller.city}/>
            ))}
        </View>
    )
};

export default SellersList;
